description:
VocabuLearn - Dutch Language Power!

Expanding your foreign language vocabulary is essential in developing the power to really communicate in Dutch. Dutch VocabuLearn is unique in its ability to build vocabulary aurally. Over 5000 Dutch words organized into the categories: nouns, adjectives and adverbs, expressions, and verbs. Level One contains most frequently used Dutch words and phrases. Level Two presents increasingly more complex terms. 

